import { sql_query } from './db'

const handlerSaoPaulo = async (_, res) => {
  try{
    const results = await sql_query(`SELECT * FROM tab_menu WHERE mn_oculto=0 AND mn_destaque=1 AND mn_esubpasta=152 ORDER BY mn_peso desc, mn_titulo DESC LIMIT 12`)

    return res.json(results)
  } catch (e) {
    
    res.status(500).json({ message: e.message })
    
  }
}

export default handlerSaoPaulo
